function crispInit() {
    var d = document;
    var s = d.createElement("script");
    s.src = "https://client.crisp.chat/l.js";
    s.async = 1;
    d.getElementsByTagName("head")[0].appendChild(s);
}

function openChat() {
    $("a[rel='noopener noreferrer nofollow']").closest("div").remove();
}
$crisp.push(["on", "chat:opened", openChat]);
